import React from "react";
// import "./style.css";

function SearchResults(props) {
  return (
    <ul className="list-group search-results">
      {props.results.name.map(result => (
        <li key={result.name.first} className="list-group-item">
      {result.name.first}
        {result.name.last}
        </li>
    ))} 
    </ul>
  );
}

export default SearchResults;
